import React from "react";
import { Box, Typography, Card, CardContent, Button, Grid } from "@mui/material";

const MissPoppins: React.FC = () => {
  return (
    <Box sx={{ padding: "20px", fontFamily: "Arial, sans-serif" }}>
      {/* Header Section */}
      <Box sx={{ marginBottom: "20px" }}>
        <Typography variant="h4" sx={{ color: "#4A148C", fontWeight: "bold" }}>
          MissPoppins App Redesign:
        </Typography>
        <Typography
          variant="h6"
          sx={{ color: "#6A1B9A", marginTop: "8px", marginBottom: "20px" }}
        >
          Simplifying Navigation and Boosting User Engagement
        </Typography>
      </Box>

      {/* Overview Card */}
      <Card
        sx={{
          backgroundColor: "#F3E5F5",
          borderRadius: "10px",
          marginBottom: "20px",
          padding: "10px",
        }}
      >
        <CardContent>
          <Typography variant="body1" sx={{ marginBottom: "10px" }}>
            <strong>Overview:</strong> Streamlined navigation and introduced
            strategic pricing to enhance the coach-client experience.
          </Typography>
          <Typography variant="body1" sx={{ marginBottom: "10px" }}>
            <strong>Role:</strong> UX Researcher, UX/UI Designer
          </Typography>
          <Typography variant="body1">
            <strong>Toolkit:</strong> Figma, FigJam, Pencil and Paper
          </Typography>
        </CardContent>
      </Card>

      {/* Mobile Preview */}
      <Grid container spacing={2}>
        <Grid item xs={12} md={6}>
          {/* Mockup Device Section */}
          <Box
            sx={{
              display: "flex",
              justifyContent: "center",
              alignItems: "center",
              border: "1px solid #E0E0E0",
              borderRadius: "10px",
              padding: "10px",
              backgroundColor: "#FFFFFF",
              boxShadow: "0px 4px 6px rgba(0, 0, 0, 0.1)",
            }}
          >
            <img
              src="/path-to-your-mobile-mockup.png"
              alt="MissPoppins Mobile Mockup"
              style={{ maxWidth: "100%", height: "auto", borderRadius: "15px" }}
            />
          </Box>
        </Grid>
      </Grid>
    </Box>
  );
};

export default MissPoppins;
